import React from "react";
import "./SiparisOnayı.css"
 
 const SiparisOnay= ()=>{

    return (
        <div className="onay" style={{backgroundImage:`url(./banner.png)`}}>
          <h1>Teknolojik Yemekler</h1>
          <br/>
          <h2 className="text">TEBRİKLER!</h2>
          <br/>
          <h2 className="text">SİPARİŞİNİZ ALINDI</h2>
        </div>
      );

}

export default SiparisOnay;
